import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default () => {
    const [posts, setPosts] = useState({});
    const fetchPosts = async () => {
        const res = await axios.get('http://localhost:4000/posts');
        setPosts(res.data);
    };
    useEffect(()=>{
        fetchPosts();
    }, []);
    console.log(posts);
    return (<div>$posts[0]</div>);
}
